description:
Season 3, Episode 1: Air Mater

A tow service leads Mater in the world of planes. Amazed by all these flying machines, Mater gets interested in learning to fly.

Air Mater is the tenth episode in the Cars Toons series. It was released with the DVD and Blu-ray release of Cars 2, and is Pixar Canadas first production.
